import React from "react";
import { motion } from "framer-motion";
import '../HomePage.css'

const HomePage = ({ onEnter }) => {
  return (
    <div className="flex flex-col items-center justify-center h-screen bg-blue-400">
      <motion.img 
        src="/avatar.png" 
        alt="Avatar" 
        className="w-40 h-40 mb-4" 
        initial={{ opacity: 0, scale: 0.5 }}
        animate={{ opacity: 1, scale: 1 }}
        transition={{ duration: 0.8 }}
      />
      <motion.h1 
        className="text-white text-3xl font-bold" 
        initial={{ y: -20, opacity: 0 }}
        animate={{ y: 0, opacity: 1 }}
        transition={{ duration: 0.8, delay: 0.5 }}
      >
        Marwah Raja
      </motion.h1>
      <motion.p 
        className="text-yellow-300 text-lg" 
        initial={{ y: -10, opacity: 0 }}
        animate={{ y: 0, opacity: 1 }}
        transition={{ duration: 0.8, delay: 0.7 }}
      >
        DÃ©veloppeuse Full-stack
      </motion.p>
      <motion.button 
        onClick={onEnter}
        className="mt-6 px-6 py-3 bg-white text-blue-600 font-bold rounded-lg shadow-md hover:bg-gray-100"
        whileHover={{ scale: 1.1 }}
        whileTap={{ scale: 0.9 }}
      >
        ENTER
      </motion.button>
    </div>
  );
};

export default HomePage;
